import logo from "./react.svg";
import axios from "axios";

import "./Home.css";

interface IRestaurant {
  name: string;
  Description: string;
  id: string;
}

class Home extends React.Component<{}, {}> {
  state = {
    restaurants: Array<IRestaurant>(),
    error: null,
  };

  componentDidMount = async () => {
    try {
      const response = await axios.get("http://localhost:1337/restaurants");
      // console.log(response.data[0].Description);
      this.setState({ restaurants: response.data });
    } catch (error) {
      this.setState({ error });
    }
  };
  public render() {
    const { error, restaurants } = this.state;
    return (
      <div className="Home">
        {/*        <div className="Home-header">
          <img src={logo} className="Home-logo" alt="logo" />
          <h2>Welcome to Razzles</h2>
        </div> */}
        {/* <p className="Home-intro">
          To get started, edit <code>src/App.tsx</code> or{" "}
          <code>src/Home.tsx</code> and save to reload.
        </p>
        <ul className="Home-resources">
          <li>
            <a href="https://github.com/jaredpalmer/razzle">Docs</a>
          </li>
          <li>
            <a href="https://github.com/jaredpalmer/razzle/issues">Issues</a>
          </li>
          <li>
            <a href="https://palmer.chat">Community Slack</a>
          </li>
        </ul> */}
        <ul>
          {restaurants.map((rest) => {
            return (
              <i key={rest.id}>
                {rest.name}--{rest.Description}
              </i>
            );
          })}
          here
        </ul>
      </div>
    );
  }
}

export default Home;
